import React from 'react';
import {Grid} from '@material-ui/core'; 
import Product from './Product/Product';

const products = [
    { id: 1, name: 'Shoes', description: 'Runnig Shoes', price:'$5', image:'https://www.google.com/imgres?imgurl=https%3A%2F%2Fwww.gizmochina.com%2Fwp-content%2Fuploads%2F2019%2F09%2FApple-iPhone-11-1.jpg&imgrefurl=https%3A%2F%2Fwww.gizmochina.com%2Fproduct%2Fapple-iphone-11%2F&tbnid=iMVt9wLyySov6M&vet=12ahUKEwje-vyf1Lj1AhWF0OAKHRpuCAoQMygDegUIARDfAQ..i&docid=MKFmtynrtiDI3M&w=500&h=500&itg=1&q=iphone&ved=2ahUKEwje-vyf1Lj1AhWF0OAKHRpuCAoQMygDegUIARDfAQ' },
    { id: 2, name: 'Macbook', description: 'Apple macbook', price:'$50', image:'https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.verizon.com%2Fsmartphones%2Fsamsung-galaxy-s21-ultra-5g%2F&psig=AOvVaw1faDJha54ARQXGzXWzFgX_&ust=1642504606393000&source=images&cd=vfe&ved=0CAgQjRxqFwoTCKi8juTUuPUCFQAAAAAdAAAAABAF'},
]

const Products = () => {
    return (
        <main>
            <Grid container justify='center' spacing={6}> 
                {products.map((product) => (
                    <Grid item key={product.id} xs={12} sm={6} md={4} lg={3} >
                        <Product product={product} />
                    </Grid>
                ))}
            </Grid>
        </main>
    )
}

export default Products;
